import * as React from "react";
import { Box, Typography, AppBar, Toolbar, IconButton, Button, TextField } from "@mui/material";
import ShoppingCartIcon from "@mui/icons-material/ShoppingCart";
import CalendarTodayIcon from "@mui/icons-material/CalendarToday";
import HomeIcon from "@mui/icons-material/Home";
import PhotoCameraIcon from "@mui/icons-material/PhotoCamera";
import PersonIcon from "@mui/icons-material/Person";
import LibraryMusicIcon from "@mui/icons-material/LibraryMusic";
import SpaIcon from "@mui/icons-material/Spa";
import { Link } from "react-router-dom";

export default function NewPage() {
  const [selectedDate, setSelectedDate] = React.useState("January 22, 2025");

  return (
    <>
      {/* AppBar */}
      <AppBar position="sticky" color="default" elevation={1} sx={{ paddingX: 4, backgroundColor: "#fff" }}>
        <Toolbar
          sx={{
            display: "flex",
            justifyContent: "space-between",
            alignItems: "center",
          }}
        >
          {/* Logo */}
          <Box
            component={Link}
            to="/new"
            sx={{
              textDecoration: "none",
              display: "flex",
              alignItems: "center",
              gap: 1,
            }}
          >
            <Box
              sx={{
                width: 40,
                height: 40,
                backgroundColor: "#ccc",
                borderRadius: "50%",
              }}
            />
            <Typography
              variant="h6"
              sx={{
                fontWeight: "bold",
                textTransform: "uppercase",
              }}
            >
              Logo Placeholder
            </Typography>
          </Box>

          {/* Navigation Links */}
          <Box
            sx={{
              display: "flex",
              alignItems: "center",
              gap: 3,
            }}
          >
            <Button component={Link} to="/venues" color="inherit" startIcon={<HomeIcon />} sx={{ textTransform: "uppercase" }}>
              Venues
            </Button>
            <Button component={Link} to="/hair" color="inherit" startIcon={<SpaIcon />} sx={{ textTransform: "uppercase" }}>
              Hair
            </Button>
            <Button component={Link} to="/makeup" color="inherit" startIcon={<PhotoCameraIcon />} sx={{ textTransform: "uppercase" }}>
              Makeup
            </Button>
            <Button component={Link} to="/photographers" color="inherit" startIcon={<PersonIcon />} sx={{ textTransform: "uppercase" }}>
              Photographers
            </Button>
            <Button component={Link} to="/music" color="inherit" startIcon={<LibraryMusicIcon />} sx={{ textTransform: "uppercase" }}>
              Music
            </Button>
          </Box>

          {/* Shopping Cart */}
          <IconButton component={Link} to="/cart" color="inherit">
            <ShoppingCartIcon />
          </IconButton>
        </Toolbar>
      </AppBar>

      {/* Main Content */}
      <Box sx={{ padding: 4, backgroundColor: "#f9f9f9" }}>
        {/* Selected Date */}
        <Box
          sx={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            marginBottom: 4,
            gap: 1,
          }}
        >
          <CalendarTodayIcon />
          <Typography variant="h6" color="textSecondary">
            Selected Date: {selectedDate}
          </Typography>
        </Box>

        {/* Search Filters */}
        <Box
          sx={{
            display: "flex",
            justifyContent: "space-between",
            alignItems: "center",
            backgroundColor: "#fff",
            padding: 2,
            borderRadius: 2,
            boxShadow: 1,
            marginBottom: 4,
          }}
        >
          <TextField label="Where" variant="outlined" fullWidth sx={{ marginRight: 2 }} />
          <TextField label="Check-in" variant="outlined" fullWidth sx={{ marginRight: 2 }} />
          <TextField label="Check-out" variant="outlined" fullWidth sx={{ marginRight: 2 }} />
          <TextField label="Who" variant="outlined" fullWidth sx={{ marginRight: 2 }} />
          <Button variant="contained" color="primary" sx={{ paddingX: 4 }}>
            Search
          </Button>
        </Box>

        {/* Example Items */}
        <Box sx={{ display: "flex", gap: 2, flexWrap: "wrap", justifyContent: "center" }}>
          {[1, 2, 3, 4].map((item) => (
            <Box
              key={item}
              sx={{
                width: 300,
                backgroundColor: "#fff",
                padding: 2,
                borderRadius: 2,
                boxShadow: 1,
                textAlign: "center",
              }}
            >
              <Box
                sx={{
                  width: "100%",
                  height: 180,
                  backgroundColor: "#ccc",
                  borderRadius: 2,
                  marginBottom: 2,
                }}
              />
              <Typography variant="subtitle1">Guest favorite</Typography>
              <Typography variant="h6" fontWeight="bold">
                Example Item {item}
              </Typography>
              <Typography variant="body2" color="textSecondary">
                Description here
              </Typography>
              <Typography variant="body1" fontWeight="bold" color="primary">
                $200 / night
              </Typography>
            </Box>
          ))}
        </Box>
      </Box>
    </>
  );
}
